// import './AboutUs.css'

function AboutUs() {
    return ( 
        <>
        {/* <section> */}
            <div class = "image">
               <img src="https://cdn.pixabay.com/photo/2017/08/26/23/37/business-2684758__340.png"></img>
            </div>

            <div class = "content">
                <h2>About Us</h2>
                <span>
                    {/* <!-- line here --> */}
                    </span>
                <p>Welcome to our new website. We encourage you to find out more about the values and vision that guides us, the services and programs we offer, the indicators that ensure our continued accountability and transparency, and the news and events that matter most to you. It is the place where you will find information on career opportunities with HMH and be able to access general healthcare information to keep you well informed. India Hospital has a proud tradition of care. For Last so many years, India Hospital has cared for the people of Lucknow, surrounding communities, and beyond, being a significant player within the District. Residing in the heart of a beautiful cottage country on the shores of the Gomti River, we offer healthcare not only to our community residents but to the many visitors who frequent our beautiful area year round.</p>
                <h1>Mission</h1>
            <p>Mission The mission of India Hospital is to provide quality health services and facilities for the community, to promote wellness, to relieve suffering, and to restore health as swiftly, safely, and humanely as it can be done, consistent with the best service we can give at the highest value for all concerned</p>
               <h1>Vison</h1>
               <p>To provide each patient with the world-class care, exceptional service and compassion we would want for our loved ones and To Lead the evolution of healthcare to enable every member of the communities we serve to enjoy a better, healthier life</p>


            </div>
        </>
     );
}

export default AboutUs;
